# There are times when we need to heuristically guess what outcode is intended by a partial GB postcode
# We have some heuristics to do this, but there are cases where they'll guess wrong but a human familiar
# with the list of actually-existing (extant) postcodes can do better.
# For example, when given "GL71", our heuristic will guess that that refers to outcode "GL71", but 
# there is no such outcode in real life, so we should know better and return "GL7".
# The following list provides a set of known-to-exist (extant) outcodes.
# This list was obtained by looking at geonames.org, cross-checking against the UK ONS data, geopostcodes.com
# and royalmail.co.uk.
#
# Note that we probably shouldn't be using this list to validate postcodes (because the Royal Mail may add a new one
# without warning at any time), but it should be good enough as an aid for our heuristic that guesses at outcodes.
#
